import React from "react";
import routes from "routes";
import DefaultNavbar from "examples/Navbars/DefaultNavbar";
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";

import bgImage from "assets/images/bg-sign-in.jpeg";
function Reservation(){
    return(<>

      <input type="text" name="price" placeholder="Prix maximum"  />
      <select name="rating" >
        <option value="">Tous les ratings</option>
        <option value="5">5 étoiles</option>
        <option value="4">4 étoiles</option>
        {/* Ajoutez d'autres options de rating ici <DefaultNavbar
        routes={routes}
        action={{
            type: "internal",
            route: "/register",
            label: "Register Now",
            color: "error",
        }}
        transparent
        light /><MKBox
            position="absolute"
            top={0}
            left={0}
            zIndex={1}
            width="100%"
            minHeight="100vh"
            sx={{
                backgroundImage: ({ functions: { linearGradient, rgba }, palette: { gradients } }) => `${linearGradient(
                    rgba(gradients.dark.main, 0.6),
                    rgba(gradients.dark.state, 0.6)
                )}, url(${bgImage})`,
                backgroundSize: "cover",
                backgroundPosition: "center",
                backgroundRepeat: "no-repeat",
            }} />*/}
      </select>

      {/* Bouton pour appliquer le filtre */}
      <button >Appliquer le filtre</button>
            </>);
}
export default Reservation;
